import React, { Component } from 'react';
import './App.css';
import Table from './Table'

var data = [
  {investor_name: 'Investor 1', commitment: '10,000,000', prior_contribution: '1,100,000',transfer_contribution: '550,000',unfunded_commitment: '8,350,000'},
  {investor_name: 'Investor 2', commitment: '16,000,000', prior_contribution: '1,760,000',transfer_contribution: '880,000',unfunded_commitment: '13,360,000'},
  {investor_name: 'Investor 3', commitment: '16,000,000', prior_contribution: '1,760,000',transfer_contribution: '880,000',unfunded_commitment: '13,360,000'},
  {investor_name: 'Investor 4', commitment: '50,000,000', prior_contribution: '550',transfer_contribution: '275',unfunded_commitment: '4,175,000'},
  {investor_name: 'Investor 5', commitment: '20,000,000', prior_contribution: '220',transfer_contribution: '110',unfunded_commitment: '1,670,000'},
  {investor_name: 'Investor 2', commitment: '1,000,000', prior_contribution: '110',transfer_contribution: '55',unfunded_commitment: '835'}

];



class App extends Component {
  render() {
    return (
      <div className="App">
        <p className="Table-header">Table</p>
        <Table data={data}/>
        <button className ="buton">Load PDF</button>
      </div>
    );
  }
}

export default App;
